import "../../components/homeContent/about.css";

function About() {
  return (
    <div className="aboutDiv">
      <div className="backgroundColorDiv"></div>
      <div className="contentDiv">
        <div className="first"></div>
      <img
        src="https://img.freepik.com/free-photo/portrait-corporate-woman-working-with-laptop-smiling-looking-assertive-white-background_1258-88546.jpg?w=900&t=st=1695291351~exp=1695291951~hmac=2aa406e232d04faf0c16676bd15a6ae5c28823ec8f7c565840847f2078825f0a"
        alt="instructorImg"
      ></img>
        <h2 className="heading">About us</h2>
        <p className="about">
         Valmiki is a curated platform where students can find courses on almost any topic. It has an embedded coding platform for hands-on practice. Best part-It's totally free{" "}
        </p>
   
      </div>
    </div>
  );
}

export default About;
